I don't think this is need a enter press after fill number in text. the currently behaviour is different with Windows.

When we call spinner.getSelection(), it returns the position of the scroller. Value in the text can be changed when we increase of decrease the scroller, but if we change the value in the text field(No Enter), the position of the scroller would not change automaticlly. So the getSelection method still returns the old value. 

One solution can be:

public int getSelection(){

 checkWidget();
 int value = getSelectionText();
 setSelection(value);
 return value;
}

